import {makeStyles, createStyles, Theme} from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {
            flexGrow: 1,
        },
    }),
);

interface VideoResponse {
}


export default function VideoSingleContainer() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Grid container spacing={2}>
                <Grid item xs={12} sm={9}>
                    <div style={{
                        border: '1px solid black',
                        objectFit: 'contain'
                    }}>
                        <video width={`100%`} controls src="#" poster="http://unsplash.it/250/150?gravity=center">
                            Your browser does not support the video tag.
                        </video>
                    </div>

                </Grid>
                <Grid item xs={12} sm={3}>
                    <div style={{
                        border: '1px solid black',
                        width: '100%',
                    }}>
                        <h2>More</h2>
                        <div id="wrapper">
                            <video width={`100%`} controls src="#" poster="http://unsplash.it/250/150?gravity=center">
                                Your browser does not support the video tag.
                            </video>
                        </div>
                        <div id="wrapper">
                            <img src="http://unsplash.it/250/150?gravity=center" width="50" height="50" />
                            <video width="320" height="240" controls src="#">
                                Your browser does not support the video tag.
                            </video>
                        </div>
                        <div id="wrapper">
                            <img src="http://unsplash.it/250/150?gravity=center" width="50" height="50" />
                            <video width="320" height="240" controls src="#">
                                Your browser does not support the video tag.
                            </video>
                        </div>
                    </div>
                </Grid>
            </Grid>

            <style>
                {`
                #wrapper{
  position: relative
}
#wrapper video{
  position: relative;
  z-index: 100;
}
#wrapper img{
  position: absolute;
  display: block;
  z-index: 150;
  left: 10px;
  top: 10px;
}`}
            </style>
        </div>
    )
}
